INSERT INTO `productos` (`id`, `id_categoria`, `id_subcategoria`, `tipo`, `ruta`, `estado`, `titulo`, `titular`, `descripcion`, `multimedia`, `detalles`, `precio`, `portada`, `vistas`, `ventas`, `vistasGratis`, `ventasGratis`, `ofertadoPorCategoria`, `ofertadoPorSubCategoria`, `oferta`, `precioOferta`, `descuentoOferta`, `imgOferta`, `finOferta`, `peso`, `entrega`, `fecha`) VALUES
(74, 14, 62, 'virtual', '10-peces-marinos-para-principiantes', 1, '10 peces marinos para principiantes', 'Aquí les dejo una lista de 10 peces marinos para principiantes ...', 'Aquí les dejo una lista de 10 peces marinos para principiantes ', 'Hau3_NouAIc', '{}', 0, 'vistas/img/productos/10-peces-marinos-para-principiantes.png', 0, 0, 25, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-06 15:32:05'),
(85, 14, 62, 'virtual', 'pez-marino-foxface', 1, 'Pez Marino FoxFace', 'El Siganus vulpinus es el pez conejo más habitual en el comercio y destaca morfológicamente por presentar un arco chocolate oscuro que recorre desde la base de su primera espina dorsal hasta la barbilla y una zona blanca an...', 'El Siganus vulpinus es el pez conejo más habitual en el comercio y destaca morfológicamente por presentar un arco chocolate oscuro que recorre desde la base de su primera espina dorsal hasta la barbilla y una zona blanca ancha detrás de la barrera ocular.', 'FuTffrXxK-0', '{}', 0, 'vistas/img/productos/pez-marino-foxface.png', 0, 0, 13, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-08 01:36:57'),
(86, 14, 62, 'virtual', 'pez-marino-blue-tang', 1, 'Pez Marino Blue Tang', 'Especie compatible con otros peces marinos, siempre que se disponga de suficiente espacio para evitar agresiones por territorialidad, si se mantienen ejemplares de la misma especie o mismo género, es necesario una convivenci...', 'Especie compatible con otros peces marinos, siempre que se disponga de suficiente espacio para evitar agresiones por territorialidad, si se mantienen ejemplares de la misma especie o mismo género, es necesario una convivencia desde joven para que estén adaptados y acostumbrados a la vida en comunidad.', 'vkl3tAQq3L4', '{}', 0, 'vistas/img/productos/pez-marino-blue-tang.png', 0, 0, 30, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-03 16:08:55'),
(88, 14, 62, 'virtual', 'pez-marino-naso-elegans', 1, 'pez marino naso elegans', 'Aqui les dejo este video tutorial del pez cirujano naso Rubio conosido cientificamente como naso elegant....', 'Aqui les dejo este video tutorial del pez cirujano naso Rubio conosido cientificamente como naso elegant.', 'rC6JPcAiaOo', '{}', 0, 'vistas/img/productos/pez-marino-naso-elegans.png', 0, 0, 24, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-07-31 18:04:21'),
(91, 14, 62, 'virtual', 'pez-marino-power-blue', 1, 'Pez marino power blue', 'Tiene una forma oval con cuerpo muy colorido y marcas audaces. Es muy apreciado por sus colores vivos y marcas con varios tonos diferentes de azul con detalles de color amarillo y blanco. Un color brillante amarillo destaca l...', 'Tiene una forma oval con cuerpo muy colorido y marcas audaces. Es muy apreciado por sus colores vivos y marcas con varios tonos diferentes de azul con detalles de color amarillo y blanco. Un color brillante amarillo destaca las aletas dorsales y pectorales, y las marcas de color negro azulado llamativas.', 'os5csq0cKPg', '{}', 0, 'vistas/img/productos/pez-marino-power-blue.png', 0, 0, 6, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-07-28 02:30:11'),
(92, 14, 62, 'virtual', 'copperband-butterfly', 1, 'Copperband Butterfly', 'El pez mariposa de nariz alargada (Chelmon rostratus ) es un pez marino, de la familia Chaetodontidae. Es uno de los peces marinos más populares y solicitados en acuariofilia marina. Su población salvaje es abundante, siend...', 'El pez mariposa de nariz alargada (Chelmon rostratus ) es un pez marino, de la familia Chaetodontidae. Es uno de los peces marinos más populares y solicitados en acuariofilia marina. Su población salvaje es abundante, siendo una especie común y estable.', 'hC4XhRSkfUg', '{}', 0, 'vistas/img/productos/copperband-butterfly.png', 0, 0, 49, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-07-28 01:57:52'),
(93, 14, 62, 'virtual', 'pez-mandarin', 1, 'Pez Mandarin', 'Conocido comúnmente como pez mandarín o pez dragón puede ser encontrado bajo distintos seudónimos en la bibliografía especializada: Callionymus splendidus, Neosynchiropus splendidus o Pterosynchiropus splendidus....', 'Conocido comúnmente como pez mandarín o pez dragón puede ser encontrado bajo distintos seudónimos en la bibliografía especializada: Callionymus splendidus, Neosynchiropus splendidus o Pterosynchiropus splendidus.', 'AtLawAa3TkU', '{}', 0, 'vistas/img/productos/pez-mandarin.png', 0, 0, 16, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-03 07:41:47'),
(94, 14, 62, 'virtual', 'angel-bicolor', 1, 'Angel Bicolor', 'Aunque no se trata de una de las especies del género Centropyge más pequeñas, El Centropyge bicolor tiene ganado un puesto de honor entre aquellas más atractivas que se pueden contemplar en un acuario marino doméstico. ...', 'Aunque no se trata de una de las especies del género Centropyge más pequeñas, El Centropyge bicolor tiene ganado un puesto de honor entre aquellas más atractivas que se pueden contemplar en un acuario marino doméstico. ', '_plrkZYhhNA', '{}', 0, 'vistas/img/productos/angel-bicolor.png', 0, 0, 22, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-04 07:57:53'),
(95, 14, 62, 'virtual', 'purple-tang', 1, 'Purple Tang', 'El Zebrasoma xanthurum o cirujano púrpura, como se denomina comúnmente, pertenece a la familia Acanthuridae incluida en el orden de los Perciformes.  La característica distintiva de esta familia es una pareja de espinas, u...', 'El Zebrasoma xanthurum o cirujano púrpura, como se denomina comúnmente, pertenece a la familia Acanthuridae incluida en el orden de los Perciformes.  La característica distintiva de esta familia es una pareja de espinas, una a cada lado de la cola, muy peligrosas que eriza como defensa a su voluntad.', 'UqENWcwa6A4', '{}', 0, 'vistas/img/productos/purple-tang.png', 0, 0, 18, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-02 21:47:10'),
(96, 10, 32, 'fisico', 'filtro-de-esponja-grande-sobo', 1, 'FILTRO DE ESPONJA GRANDE SOBO', 'El filtro de esponja de acuario proporciona el agua con oxígeno muy necesario, proporciona filtración biológica y calidad de agua estable....', 'El filtro de esponja de acuario proporciona el agua con oxígeno muy necesario, proporciona filtración biológica y calidad de agua estable.', '[{\"foto\":\"vistas/img/multimedia/filtro-de-esponja-grande-sobo/IMAGEN PRINCIPAL.jpg\"},{\"foto\":\"vistas/img/multimedia/filtro-de-esponja-grande-sobo/IMAGEN INTERNA.jpg\"}]', '{\"Talla\":[\"GRANDE SB-3330\"],\"Color\":[],\"Marca\":[\"SOBO\"]}', 25, 'vistas/img/productos/filtro-de-esponja-grande-sobo.jpg', 24, 0, 1, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-06 02:52:58'),
(97, 10, 57, 'fisico', 'filtro-aereo-venus-aqua-600t', 1, 'FILTRO AEREO VENUS AQUA 600T', 'Filtros aéreos con gran capacidad para material filtrante en sus distintas presentaciones de la marca VENUSAQUA...', 'Filtros aéreos con gran capacidad para material filtrante en sus distintas presentaciones de la marca VENUSAQUA', '[{\"foto\":\"vistas/img/multimedia/filtro-aereo-venus-aqua-600t/IMAGEN PRINCIPAL.jpg\"},{\"foto\":\"vistas/img/multimedia/filtro-aereo-venus-aqua-600t/IMAGEN INTERNA.jpg\"}]', '{\"Talla\":[\"600T - 650 L/H\"],\"Color\":[],\"Marca\":[\"VENUS AQUA\"]}', 36, 'vistas/img/productos/filtro-aereo-venus-aqua-600t.jpg', 53, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-07 05:15:18'),
(98, 10, 57, 'fisico', 'filtro-interno-venus-aqua', 1, 'FILTRO INTERNO VENUS AQUA', 'Este filtro interno para acuarios está diseñado para uso sumergible y se puede usar en el acuario Fresh Tank. El filtro viene completo con accesorios de boquilla de aireación venturi incluidos que se pueden usar por separa...', 'Este filtro interno para acuarios está diseñado para uso sumergible y se puede usar en el acuario Fresh Tank. El filtro viene completo con accesorios de boquilla de aireación venturi incluidos que se pueden usar por separado con ambas salidas que tienen la característica de agregar más aireación a su pecera. ', '[{\"foto\":\"vistas/img/multimedia/filtro-interno-venus-aqua/IMAGEN INTERNA2 aqua venus 1800F.jpg\"},{\"foto\":\"vistas/img/multimedia/filtro-interno-venus-aqua/IMAGEN INTERNA aqua venus 1800F.jpg\"}]', '{\"Talla\":[\"2000 L/H\"],\"Color\":[],\"Marca\":[\"VENUS AQUA\"]}', 52, 'vistas/img/productos/filtro-interno-venus-aqua.jpg', 20, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 1, '2020-08-04 15:41:52'),
