(101, 10, 37, 'fisico', 'canutillos-ceramicos-minjiang-1000-ml', 1, 'CANUTILLOS CERAMICOS MINJIANG 1000 ML', 'La función de lo canutillos para acuario es la de albergar bacterias beneficiosas, capaces de transformar las sustancias químicas perjudiciales del acuario (producto de la actividad metabólica de peces y plantas, o restos ...', 'La función de lo canutillos para acuario es la de albergar bacterias beneficiosas, capaces de transformar las sustancias químicas perjudiciales del acuario (producto de la actividad metabólica de peces y plantas, o restos de comida) en compuestos inocuos y no tóxicos para la vida del acuario.', '[{\"foto\":\"vistas/img/multimedia/canutillos-ceramicos-minjiang-1000-ml/IMAGEN INTERNA CERAMICOS 1000ML 3.png\"},{\"foto\":\"vistas/img/multimedia/canutillos-ceramicos-minjiang-1000-ml/IMAGEN INTERNA MATRIX 250 ML 3.png\"}]', '{\"Talla\":[\"CERAMICOS 1000 ML\"],\"Color\":[],\"Marca\":[\"MINJIANG\"]}', 25, 'vistas/img/productos/canutillos-ceramicos-minjiang-1000-ml.png', 42, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-04 07:42:28'),
(102, 10, 37, 'fisico', 'carbon-activado-minjiang-1000-ml', 1, 'CARBON ACTIVADO MINJIANG 1000 ML', 'Las características del carbón hacen que sirva como una esponja natural, absorbiendo varios químicos (entre otros, restos de metales pesados, fosfatos, nitrato, restos de medicamentos o toxinas) y aislándolos sin peligro ...', 'Las características del carbón hacen que sirva como una esponja natural, absorbiendo varios químicos (entre otros, restos de metales pesados, fosfatos, nitrato, restos de medicamentos o toxinas) y aislándolos sin peligro hasta que retiramos el carbón y lo reemplazamos.', '[{\"foto\":\"vistas/img/multimedia/carbon-activado-minjiang-1000-ml/IMAGEN INTERNA CARBON2.png\"},{\"foto\":\"vistas/img/multimedia/carbon-activado-minjiang-1000-ml/IMAGEN INTERNA CARBON1.png\"}]', '{\"Talla\":[\"CARGON ACTIVADO 1000ML\"],\"Color\":[],\"Marca\":[\"MINJIANG\"]}', 25, 'vistas/img/productos/carbon-activado-minjiang-1000-ml.png', 11, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 1, '2020-07-10 00:31:47'),
(103, 10, 57, 'fisico', 'filtro-interno-rs-electrical-rs332f', 1, 'FILTRO INTERNO RS ELECTRICAL RS332F', 'La filtración es el corazón de un acuario. La vida acuática (o los peces) necesita agua limpia para mantenerse, por lo que la filtración de calidad es esencial e importante para tener un buen acuario. La filtración puede...', 'La filtración es el corazón de un acuario. La vida acuática (o los peces) necesita agua limpia para mantenerse, por lo que la filtración de calidad es esencial e importante para tener un buen acuario. La filtración puede ser biológica, mecánica y química.', '[{\"foto\":\"vistas/img/multimedia/filtro-interno-rs-electrical-rs332f/IMAGEN INTERNA CARBON2.jpg\"},{\"foto\":\"vistas/img/multimedia/filtro-interno-rs-electrical-rs332f/IMAGEN INTERNA1.jpg\"}]', '{\"Talla\":[\"1800 L/h\"],\"Color\":[],\"Marca\":[\"RS ELECTRICAL\"]}', 46, 'vistas/img/productos/filtro-interno-rs-electrical-rs332f.png', 11, 0, 2, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 1, '2020-07-17 02:43:55'),
