(151, 8, 47, 'fisico', 'jbl-goldpearls-1000-ml', 0, 'JBL GoldPearls 1000 ML', 'Alimento completo y crecimiento ideal en carpas doradas y colas de velo: ingredientes selectos para satisfacer las necesidades de todas las variedades de carpas doradas. Nutritivo y fácil de digerir: Las perlas que se hunden...', 'Alimento completo y crecimiento ideal en carpas doradas y colas de velo: ingredientes selectos para satisfacer las necesidades de todas las variedades de carpas doradas. Nutritivo y fácil de digerir: Las perlas que se hunden son ideales para especies de pez de mín. 8 cm en todas las zonas del agua. ', '[{\"foto\":\"vistas/img/multimedia/jbl-goldpearls-1000-ml/IMAGEN INTERNA3.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-goldpearls-1000-ml/IMAGEN INTERNA1.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-goldpearls-1000-ml/IMAGEN INTERNA.jpg\"}]', '{\"Talla\":[\"1000 ML (580GR)\"],\"Color\":[],\"Marca\":[\"JBL\"]}', 78, 'vistas/img/productos/jbl-goldpearls-1000-ml.jpg', 14, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 1, '2020-07-03 01:22:29'),
(152, 8, 47, 'fisico', 'jbl-novorift-1000-ml', 1, 'JBL NovoRift 1000 ML', 'Alimento completo y crecimiento ideal en cíclidos comedores de aufwuchs de los lagos Tanganica y Malawi. Nutritivo y fácil de digerir: Condiciones ideales de alimentación para especies de pez de 10 a 25 cm en todas las zon...', 'Alimento completo y crecimiento ideal en cíclidos comedores de aufwuchs de los lagos Tanganica y Malawi. Nutritivo y fácil de digerir: Condiciones ideales de alimentación para especies de pez de 10 a 25 cm en todas las zonas del agua. Con espirulina rica en proteínas', '[{\"foto\":\"vistas/img/multimedia/jbl-novorift-1000-ml/IMAGEN INTERNA2.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-novorift-1000-ml/IMAGEN INTERNA.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-novorift-1000-ml/IMAGEN INTERNA1.jpg\"}]', '{\"Talla\":[\"1000 ML (530GR)\"],\"Color\":[],\"Marca\":[\"JBL\"]}', 74, 'vistas/img/productos/jbl-novorift-1000-ml.jpg', 8, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 1, '2020-07-06 04:25:27'),
(153, 8, 47, 'fisico', 'jbl-agil-1000-ml', 1, 'JBL AGIL 1000 ML', 'Especialmente adaptado a las necesidades alimenticias de las tortugas acuáticas y galápagos: Alimento básico en forma de barras flotantes para tortugas con un tamaño de 10-50 cm. La lisina estimula la formación de los hu...', 'Especialmente adaptado a las necesidades alimenticias de las tortugas acuáticas y galápagos: Alimento básico en forma de barras flotantes para tortugas con un tamaño de 10-50 cm. La lisina estimula la formación de los huesos, el complejo multivitamínico y la vitamina C fortalecen y estabilizan el sistema inmunitario.', '[{\"foto\":\"vistas/img/multimedia/jbl-agil-1000-ml/IMAGEN INTERNA3.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-agil-1000-ml/IMAGEN INTERNA2.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-agil-1000-ml/IMAGEN INTERNA.jpg\"},{\"foto\":\"vistas/img/multimedia/jbl-agil-1000-ml/IMAGEN INTERNA1.jpg\"}]', '{\"Talla\":[\"1000 ML (400GR)\"],\"Color\":[],\"Marca\":[\"JBL\"]}', 68, 'vistas/img/productos/jbl-agil-1000-ml.jpg', 7, 0, 0, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 1, '2020-08-08 18:19:13');
