(154, 14, 63, 'virtual', 'aclimatacion-de-un-pez-nuevo', 1, 'Aclimatación de un Pez Nuevo', 'El proceso de agregar peces a un acuario debe ser progresivo y respetuoso con el animal, para evitar problemas en su adaptación al nuevo hábitat. En el vídeo de esta semana te presento una guía en 5 pasos para aclimatar a...', 'El proceso de agregar peces a un acuario debe ser progresivo y respetuoso con el animal, para evitar problemas en su adaptación al nuevo hábitat. En el vídeo de esta semana te presento una guía en 5 pasos para aclimatar adecuadamente los nuevos habitantes al entorno.', 'F3_Baclp8xE', '{}', 0, 'vistas/img/productos/aclimatacion-de-un-pez-nuevo.jpg', 0, 0, 11, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-04 20:37:06'),
(157, 14, 63, 'virtual', 'filtro-acuario', 1, 'filtro Acuario', 'Hay tres tipos principales de filtración en los acuarios: filtración biológica, filtración mecánica y filtración química. En muchos de los filtros de acuario se dan al menos dos de los tres tipo conjuntamente. A contin...', 'Hay tres tipos principales de filtración en los acuarios: filtración biológica, filtración mecánica y filtración química. En muchos de los filtros de acuario se dan al menos dos de los tres tipo conjuntamente. A continuación pasamos a explicar brevemente cada tipo.', 'OM8fR02pn8Q', '{}', 0, 'vistas/img/productos/filtro-acuario.jpg', 0, 0, 82, 0, 0, 0, 0, 0, 0, '', '0000-00-00 00:00:00', 0, 0, '2020-08-07 23:09:53');
